import React from "react";
import Styles from "./Profile.module.css";
import InfoBar from "./InfoBar";
export default function Profile() {
	return (
		<div className={Styles.container}>
			<InfoBar></InfoBar>

			<h1>This is my profile</h1>
		</div>
	);
}
